import React from 'react'
import {useHistory} from 'react-router-dom';
import logo from '../assets/img/logo.png';
function Navbar() {
    const histoty = useHistory()
    const salir= (e)=> {
        e.preventDefault()
        localStorage.removeItem('Token')
        histoty.push('/login')
      }
  return (
    <div className=" sm:w-auto flex flex-row justify-between px-10 bg-blue-primary p-3 text-xl uppercase sticky left-0">
        <img className="w-28 bg-white" src={logo} alt="" />
        <button
          className="uppercase text-green-primary  hover:text-white "
          onClick={()=>salir}
        >
          cerrar sesion
        </button>
      </div>
  )
}

export default Navbar
